import React from 'react';
import { View, Text, Image, } from 'react-native';
import Icon from '../assets/Food.png';

function Cart(props) {
    return (
        <View style={{
            height: 190,
            margin: 10,

            shadowOffset: {
                height: 1,
                width: 1,
            },
            shadowColor: "black",
            shadowRadius: 10,
            elevation: 10,
            shadowOpacity: .5,
            borderRadius: 10,
            padding: 10,
            flexDirection:'row',
            backgroundColor:'white',
        }}>
            <View style={{
                alignItems:'center',
                width:'35%',
                height:'100%',
                backgroundColor:'green',
                justifyContent:'center',
                alignItems:'center',
                

            }}>
            <Image  style={{
                    height:100,
                    width:100,
                }} source={Icon} />
            </View>
            <View style={{
                width:'70%',
            }}>
                <Text style={{
                    fontSize:15,
                    fontWeight:'500',
                    margin:10,

                }}>
                    Maultiple fast food item
                </Text>
            </View>

        </View>
    );
}

export default Cart;
